  false,\n\t\"url\": null,\n\t\"notes\": \"This is the fenced animal management plan
  for Neal Smith National Wildlife Refuge. Grazing by large mammals is a major factor
  in the tallgrass prairie/oak savanna ecosystem, and the Refuge is reintroducing
  bison and elk to graze the prairie. This plan outlines objectives, grazing management,
  disease prevention and control, management for public viewing, management needs,
  and equipment.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
